import './App.css';
import Productos from './Components/Productos';

function App() {
 return (
    <div className="App">
      <header className="App-header">
        <h1>System POS</h1>
      </header>
      <main className="App-main App-grid">
        <section className="App-sidebar">
          <Productos />
        </section>
        <section className="App-content">
          <Productos />
        </section>
      </main>
      <footer className="App-footer">
      </footer>
    </div>
 );
}

export default App;
